import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Modal, Form, Button } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../../hooks/useAuth';
import PropertyCard from '../Home/PropertyCard';
import axios from 'axios';

const AgentHomePage = () => {
    const [showPriceModal, setShowPriceModal] = useState(false);
    const [selectedProperty, setSelectedProperty] = useState(null);
    const [newPrice, setNewPrice] = useState('');
    const [nearbyDestinations, setNearbyDestinations] = useState([]);
    const [loading, setLoading] = useState(false);
    const { user, userProperties, logout, updatePropertyPrice } = useAuth();
    const navigate = useNavigate();

    const handleLogout = () => {
        logout();
        navigate('/login');
    };

    // Fetch nearby destinations
    useEffect(() => {
        const fetchNearbyDestinations = async () => {
            try {
                const response = await axios.get('/nearby-destinations');
                setNearbyDestinations(response.data.data || []);
            } catch (error) {
                console.error('Error fetching nearby destinations:', error);
                // Fallback data
                setNearbyDestinations([
                    { id: 1, name: 'North Goa', type: 'beach', description: 'Popular beach destination', icon: 'ðŸ–ï¸' },
                    { id: 2, name: 'South Goa', type: 'beach', description: 'Popular beach destination', icon: 'ðŸŒ´' },
                    { id: 3, name: 'Mumbai', type: 'city', description: 'For sights like Gateway of India', icon: 'ðŸ™ï¸' }
                ]);
            }
        };

        fetchNearbyDestinations();
    }, []);

    const handlePriceUpdate = (property) => {
        setSelectedProperty(property);
        setNewPrice(property.price.toString());
        setShowPriceModal(true);
    };

    const handlePriceSave = async () => {
        if (selectedProperty && newPrice) {
            setLoading(true);
            try {
                const result = await updatePropertyPrice(selectedProperty.id, parseInt(newPrice));
                if (result.success) {
                    setShowPriceModal(false);
                    setSelectedProperty(null);
                    setNewPrice('');
                }
            } catch (error) {
                console.error('Error updating price:', error);
            } finally {
                setLoading(false);
            }
        }
    };

    return (
        <>
            {/* Agent Home Header */}
            <div className="bg-white border-bottom">
                <Container>
                    <div className="d-flex justify-content-between align-items-center py-3">
                        <div>
                            <h2 className="mb-0 fw-bold">My Properties</h2>
                            <p className="mb-0 text-muted">Manage your property listings, {user?.name}</p>
                        </div>
                        <Button variant="outline-danger" onClick={handleLogout}>
                            <i className="bi bi-box-arrow-right me-2"></i>
                            Logout
                        </Button>
                    </div>
                </Container>
            </div>

            {/* Properties Section */}
            <Container className="py-5">
                <div className="mb-4">
                    <h3 className="fw-bold mb-4">Your Properties</h3>
                    <p className="text-muted mb-4">
                        You have {userProperties.length} properties. Click "Update Price" to edit pricing.
                    </p>
                    <Row className="g-4">
                        {userProperties.map(property => (
                            <Col key={property.id} md={6} lg={4} xl={3}>
                                <PropertyCard 
                                    property={property} 
                                    user={user}
                                    onPriceUpdate={handlePriceUpdate}
                                />
                            </Col>
                        ))}
                    </Row>
                </div>
            </Container>

            {/* Price Edit Modal */}
            <Modal show={showPriceModal} onHide={() => setShowPriceModal(false)}>
                <Modal.Header closeButton>
                    <Modal.Title>Update Property Price</Modal.Title>
                </Modal.Header>
                <Modal.Body>
                    {selectedProperty && (
                        <div>
                            <p className="mb-3">
                                <strong>Property:</strong> {selectedProperty.title}
                            </p>
                            <Form.Group>
                                <Form.Label>New Price (â‚¹)</Form.Label>
                                <Form.Control
                                    type="number"
                                    value={newPrice}
                                    onChange={(e) => setNewPrice(e.target.value)}
                                    placeholder="Enter new price"
                                    min="0"
                                />
                            </Form.Group>
                        </div>
                    )}
                </Modal.Body>
                <Modal.Footer>
                    <Button variant="secondary" onClick={() => setShowPriceModal(false)}>
                        Cancel
                    </Button>
                    <Button variant="danger" onClick={handlePriceSave}>
                        Update Price
                    </Button>
                </Modal.Footer>
            </Modal>
        </>
    );
};

export default AgentHomePage;
